import React from "react";
import "./Table.css";
import numeral from "numeral";

function Table({ revenueInfo }) {
  const itemMap = [];
  for (let key in revenueInfo) {
    itemMap.push(
      <div className="table">
        <tr>
          <td>{key}</td>
          <td>
            <strong>{numeral(revenueInfo[key]).format("0,0")}</strong>
          </td>
        </tr>
      </div>
    );
  }
  return itemMap;
}

export default Table;
